import React from 'react';
import ReactDOM from 'react-dom';
import Faker from 'faker';
import Navbar from './Navbar';

// <Navbar user={{ name: "Charles Maxwell", img: Faker.image.avatar() }}/>

const ContainerView = (props) => {
  return (
    <div>
      <Navbar search={props.search} user={props.user} />
        {props.children}
      <footer>
        <div className="navbar navbar-light bg-light d-flex flex-row justify-content-between align-content-stretch">
          <div>
            <p className="mb-0">Â© clubSC 2020</p>
          </div>
          <div className="navbar-nav d-flex flex-row justify-content-end">
            <a className="nav-item nav-link mr-3" href="#">Privacy Policy</a>
            <a className="nav-item nav-link" href="#">Terms and Conditions</a>
          </div>
        </div>
      </footer>
    </div>
  );
};

ContainerView.defaultProps = {
  search: false,
  user: {
    name: '',
    img: ''
  }
};

export default ContainerView;
